    @Test
    void setPlanStrategyClusterInitialRequest() {
        //Arrange
        List<Lvl3> lvl3Set = GetStrategyFlClusEligRankingUtil.getLvl3List();
        PlanStrategyDTO request = GetStrategyFlClusEligRankingUtil.getPlanStrategyRequest();
        Lvl1 lvl1 = GetStrategyFlClusEligRankingUtil.getLvl1List().stream().findFirst().orElse(null);
        Lvl2 lvl2 = GetStrategyFlClusEligRankingUtil.getLvl2List().stream().findFirst().orElse(null);
        lvl2.setLvl3List(lvl3Set);
        PlanStrategyId planStrategyId = GetSizeSPClusterObjUtil.getPlanStrategyIdForSize();
        PlanStrategy planStrategy = GetSizeSPClusterObjUtil.getPlanStrategyForSize();
        planStrategy.setPlanStrategyId(planStrategyId);
        Mockito.doNothing().when(strategySPClusterMapper).setCCTotalSizeProfilePrct(Mockito.any(),Mockito.any());
        PlanStrategyMapperDTO planStrategyMapperDTO = PlanStrategyMapperDTO.builder().planStrategy(planStrategy).lvl1(lvl1).lvl2(lvl2).request(request).build();
        //Act
        Set<PlanClusterStrategy> planClusterStrategy = strategySPClusterMapper.setPlanStrategyCluster(planStrategyMapperDTO);
        // Assert
        assertNotNull(planClusterStrategy);
        assertEquals(1, planClusterStrategy.size());

        assertEquals(Integer.valueOf(1), planClusterStrategy.stream().findFirst()
                        .flatMap(strategyMerchSPCatg -> strategyMerchSPCatg.getStrategyMerchCategorySPCluster().stream().findFirst()
                                .flatMap(strategySubSPCatg -> strategySubSPCatg.getStrategySubCatgSPClusters().stream().findFirst()
                                        .flatMap(strategyFineline -> strategyFineline.getStrategyFinelinesSPCluster().stream().findFirst()
                                                .flatMap(strategyStyle -> strategyStyle.getStrategyStylesSPClusters().stream().findFirst()
                                                        .map(strategyCC -> strategyCC.getStrategyCcSPClusters().size()))))).orElse(null));
    }

    @Test
    void updateSizeListValuesFromDBForPlanUpdate() {
        objectMapper = new ObjectMapper();
        List<SizeProfileDTO> sizeProfileStrategiesFromRequest = new ArrayList<>();
        SizeProfileDTO sizeProfile1 = GetSizeSPClusterObjUtil.getSizeProfileDTO();
        SizeProfileDTO sizeProfile2 = GetSizeSPClusterObjUtil.getSizeProfileDTO();
        sizeProfile2.setAhsSizeId(325);
        sizeProfile2.setSizeDesc("L/XL");

        sizeProfileStrategiesFromRequest.add(sizeProfile1);
        sizeProfileStrategiesFromRequest.add(sizeProfile2);

        List<SizeProfileDTO> sizeProfileStrategiesFromDB = new ArrayList<>();
        //only for the size with ahsID 324 has eligible as 1
        SizeProfileDTO sizeProfilefromDB1 = GetSizeSPClusterObjUtil.getSizeProfileDTO();
        sizeProfilefromDB1.setIsEligible(1);

        sizeProfileStrategiesFromDB.add(sizeProfilefromDB1);
        sizeProfileStrategiesFromDB.add(sizeProfile2);


        String updatedSizeStr = null;
        strategySPClusterMapper = new StrategySPClusterMapper(objectMapper, sizeAndPackService);
        updatedSizeStr = strategySPClusterMapper.getUpdatedSizeStrInDB(sizeProfileStrategiesFromRequest.toString(), sizeProfileStrategiesFromDB.toString());
        assertNotNull(updatedSizeStr);

        SizeProfileDTO[] updatedSizeProfileDTOS = strategySPClusterMapper.safeReadSizeObject(updatedSizeStr);
        assertEquals(2, updatedSizeProfileDTOS.length);
        Arrays.stream(updatedSizeProfileDTOS).forEach(sizeProfileDto -> {
            if (sizeProfileDto.getAhsSizeId().equals(324)) {
                assertEquals(1, sizeProfileDto.getIsEligible().intValue());
            }
            if (sizeProfileDto.getAhsSizeId().equals(325)) {
                assertEquals(0, sizeProfileDto.getIsEligible().intValue());
            }
        });
    }

