        StrategyCcSPCluster strategyCcSPCluster = getStrategyCustomerChoiceSPClusterv2();
        StrategyCcSPClusId StrategyCcSPClusId = getStrategyCustomerChoiceSPClusId();
        strategyCcSPCluster.getStrategyCcSPClusId().getStrategyStyleSPClusId().getStrategyFinelineSPClusId().getStrategySubCatgSPClusId().getStrategyMerchCatgSPClusId().getPlanClusterStrategyId().setAnalyticsClusterId(1);
        HashMap<StrategyCcSPClusId, Set<Integer>> mapCCSPClusIdByEligibleSizeIds = new HashMap<>();
        Set<Integer> ahsIds = new HashSet<>();
        ahsIds.add(229);
        ahsIds.add(230);
        SizeProfileDTO[] sizeProfileDTOS = new SizeProfileDTO[2];
        sizeProfileDTOS[0] = getSizeProfileObj(229, "0X", 10.00, 10.00, 0);
        sizeProfileDTOS[1] = getSizeProfileObj(230, "1X", 10.00, 10.00, 0);
        mapCCSPClusIdByEligibleSizeIds.put(StrategyCcSPClusId,ahsIds);
        when(sizeAndPackService.getTotalSizeProfilePct(strategyCcSPCluster.getSizeProfileObj(), ahsIds)).thenReturn(20.0);
        when(sizeAndPackService.getStratCCSPIdKey(mapCCSPClusIdByEligibleSizeIds, strategyCcSPCluster)).thenReturn(StrategyCcSPClusId);
