    private PlanStrategy getPlanStrategy() throws JsonProcessingException {
        PlanStrategy planStrategy = new PlanStrategy();
        planStrategy.setPlanStrategyId(getPlanStrategyId());
        planStrategy.setPlanClusterStrategies(getPlanClusterStrategies());
        return planStrategy;
    }

    private PlanClusterStrategyId getPlanClusterStrategyId(int id){
        PlanClusterStrategyId planClusterStrategyId = new PlanClusterStrategyId();
        planClusterStrategyId.setAnalyticsClusterId(id);
        planClusterStrategyId.setPlanStrategyId(getPlanStrategyId());
        return planClusterStrategyId;
    }

    private Set<PlanClusterStrategy> getPlanClusterStrategies() throws JsonProcessingException {
        Set<PlanClusterStrategy> planClusterStrategyIds = new HashSet<>();
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 0));
        planClusterStrategyIds.add(createPlanCusterStrategy(2, 0));
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 1));
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 2));
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 3));
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 4));
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 5));
        planClusterStrategyIds.add(createPlanCusterStrategy(1, 6));
        return planClusterStrategyIds;
    }

    private PlanClusterStrategy createPlanCusterStrategy(int channelId, Integer analyticClusterId) throws JsonProcessingException {
        PlanClusterStrategy planClusterStrategy = new PlanClusterStrategy();
        planClusterStrategy.setPlanClusterStrategyId(getPlanClusterStrategyId(analyticClusterId));
        planClusterStrategy.setStrategyMerchCategorySPCluster(getCategoryCluster(channelId, analyticClusterId, planClusterStrategy));
        return planClusterStrategy;
    }

